procedureJavascriptCode.code:
//Initialize variables
let candle = record.current
let length = 17
let volume = getElement('volumes', candle)
variable.totalVolume = volume.buy + volume.sell

//Initialize Arrays and fix array lengths
variable.hlc3Array.push((candle.max + candle.min + candle.close) / 3)
if (variable.hlc3Array.length > length) { variable.hlc3Array.splice(0, 1) }

variable.highArray.push(candle.max)
if (variable.highArray.length > length) { variable.highArray.splice(0, 1) }

variable.lowArray.push(candle.min)
if (variable.lowArray.length > length) { variable.lowArray.splice(0, 1) }

variable.volumeArray.push(variable.totalVolume)
if (variable.volumeArray.length > length) { variable.volumeArray.splice(0, 1) }

//calculating length for anchors
let highBar = variable.hlc3Array.length - variable.hlc3Array.indexOf(Math.max(...variable.hlc3Array))
let lowBar = variable.hlc3Array.length - variable.hlc3Array.indexOf(Math.min(...variable.hlc3Array))

//setting the auto midas anchored vwap
variable.topMid = midas(highBar, true).mid
variable.topHigh = midas(highBar, true).value
variable.botMid = midas(lowBar, false).mid
variable.botLow = midas(lowBar, false).value

//Function
//calculating VWAP
function VWAP(src, len, vol) {
	let cumulativeVol = 0
	let cumulativeVolSrc = 0

	if (len > 0) {
		for (var i = 0; i < len; i++) {
			cumulativeVol += vol[src.length - 1 - i]
			cumulativeVolSrc += (vol[src.length - 1 - i] * src[src.length - 1 - i])
		}
		return cumulativeVolSrc / cumulativeVol
	}
}

//Function
//calculating midas
function midas(len, isHigh) {
	if (len > 0) {
		mid = VWAP(variable.hlc3Array, len, variable.volumeArray)
		if (isHigh) {
			value = VWAP(variable.highArray, len, variable.volumeArray)
		} else {
			value = VWAP(variable.lowArray, len, variable.volumeArray)
		}
	}
	return {
		mid,
		value
	}
}

// NaN -> 0
variable.topMid = variable.topMid || 0
variable.topHigh = variable.topHigh || 0
variable.botMid = variable.botMid || 0
variable.botLow = variable.botLow || 0
